const WordGuessingGame = () => {
    const [word, setWord] = useState('');
    const [hint, setHint] = useState('');
    const [maxGuesses, setMaxGuesses] = useState(0);
    const [incorrectLetters, setIncorrectLetters] = useState([]);
    const [correctLetters, setCorrectLetters] = useState([]);
    const [currentInput, setCurrentInput] = useState('');

    const randomWord = () => {
        const randomIndex = Math.floor(Math.random() * wordList.length);
        const randomItem = wordList[randomIndex];
        setWord(randomItem.word);
        setHint(randomItem.hint);
        setMaxGuesses(randomItem.word.length >= 5 ? 8 : 6);
        setIncorrectLetters([]);
        setCorrectLetters([]);
    };

    useEffect(() => {
        randomWord();
    }, []);

    const handleInputChange = (e) => {
        const key = e.target.value.toLowerCase();
        setCurrentInput(key);
    };

    const initGame = () => {
        if (currentInput.match(/^[A-Za-z]+$/) && !incorrectLetters.includes(` ${currentInput}`) && !correctLetters.includes(currentInput)) {
            if (word.includes(currentInput)) {
                const updatedCorrectLetters = [...correctLetters, currentInput];
                setCorrectLetters(updatedCorrectLetters);
            } else {
                setMaxGuesses(maxGuesses - 1);
                setIncorrectLetters([...incorrectLetters, ` ${currentInput}`]);
            }
        }
        setCurrentInput('');
    };

    useEffect(() => {
        if (correctLetters.length === word.length) {
            alert(`Congrats! You found the word ${word.toUpperCase()}`);
            randomWord();
        } else if (maxGuesses < 1) {
            alert("Game over! You don't have remaining guesses");
            // You might want to handle other things here like revealing the word
            randomWord();
        }
    }, [correctLetters, maxGuesses]);

    return (
        <div className="wrapper">
            <h1>Guess the Word</h1>
            <div className="content">
                <input type="text" className="typing-input" maxLength="1" value={currentInput} onChange={handleInputChange} />
                <div className="inputs">
                    {word.split('').map((letter, index) => (
                        <input key={index} type="text" disabled value={correctLetters.includes(letter) ? letter : ''} />
                    ))}
                </div>
                <div className="details">
                    <p className="hint">Hint: <span>{hint}</span></p>
                    <p className="guess-left">Remaining guesses: <span>{maxGuesses}</span></p>
                    <p className="wrong-letter">Wrong letters: <span>{incorrectLetters}</span></p>
                </div>
                <button className="reset-btn" onClick={randomWord}>Reset Game</button>
            </div>
        </div>
    );
};

export default WordGuessingGame;
